        public List<Crafts> SearchCrafts() {
            _i.ClearLv(_i.listView2);
            List<Crafts> canCraft = new List<Crafts> { };


            List<ListViewItem> _LVI = new List<ListViewItem> { };
            foreach (Crafts item in _i.listCrafts.allCrafts) {
                if (item.items.Count == 0) break;
                List<Items> itemsCrafts = new List<Items>();
                foreach (int[] _int in item.items) {
                    Items original = _i.listItems.allItems.Find(x => x.id == _int[0]);
                    Items getIt = new Items(original.id, original.nom, original.description);
                    getIt.qty = _int[1];
                    itemsCrafts.Add(getIt);
                }

                bool craftable = true;
                foreach (Items _itCraft in itemsCrafts) {
                    if (_i.listItems.banque.Find(x => x.id == _itCraft.id && x.qty >= _itCraft.qty) == null) {
                        craftable = false;
                        break;
                    }
                }

                if (craftable) {
                    canCraft.Add(item);
                    Items _it = _i.listItems.allItems.Find(x => x.id == item.resultat);
                    ListViewItem LVI = new ListViewItem(_it.id.ToString());
                    LVI.SubItems.Add(_it.nom);
                    LVI.SubItems.Add("");

                    int max = 9999999;
                    foreach (int[] _ress in item.items) {
                        Items _itN = _i.listItems.allItems.Find(x => x.id == _ress[0]);
                        Items _itB = _i.listItems.banque.Find(x => x.id == _ress[0]);
                        LVI.SubItems.Add(_ress[1] + "x" + _itN.nom);
                        int _qty = _itB.qty / _ress[1];
                        if (max > _qty) max = _qty;
                    }
                    LVI.SubItems[2].Text = max.ToString();
                    _LVI.Add(LVI);
                }
            }

            _i.ListBegin(_i.listView2);
            _i.AddItem(_i.listView2, _LVI);
            _i.ListEnd(_i.listView2);
            return canCraft;
        }
